    constructor(props : Props){
        super(props);
        this.state={}
    }

    styles = {
        position : 'relative',
        height : '100px'
    }

    private renderNotifications(){
        return(
            <div style={this.styles}>
                <div style={{marginLeft : '30px'}}><Typography variant='h5'>Уведомления</Typography></div>
                <div style={{position : 'relative', bottom : '0px'}}><hr/></div>
            </div>
        )
    }

    render(){
        return this.renderNotifications();
    }
}

export default Notifications
